import React from "react";

const ImageDisplay = (props) => {
  return (
    <div className="imageDisplay f3 dark-red b center pt5">
      {props?.url?.length > 0 ? (
        <img src={props.url} alt="Invalid image" className="" />
      ) : null}
      {props?.concepts?.length > 0 ? (
        <ul className="white w-30">
          {props.concepts.map((x) => (
            <li>{x.name}</li>
          ))}
        </ul>
      ) : null}
    </div>
  );
};
export default ImageDisplay;
